slider=(()=>{let t="",e=document.getElementById("atm-sliderTutorial"),d=e.getElementsByClassName("atm-slideTuto"),l=70*parseInt(d.length),a=e.getElementsByClassName("atm-wrappSlider");a[0].style.width=l+"vw";for(let e=0;e<d.length;e++)d[e].setAttribute("id","slide"+e),t=0==e?t+'<button data-id="'+e+'" class="activeDot"></button>':t+'<button data-id="'+e+'"></button>';let s=document.createElement("div");s.innerHTML=t,s.classList.add("atm-dotsSlider"),e.appendChild(s)}),window.onload=(()=>{slider()});